function formatTime(e){const t=Math.floor(e/60),n=Math.round(e%60);return`${t}:${n.toString().padStart(2,"0")}`}function formatElgeisDate(e){const t=new Date(e*1e3),o=2018,i=7,a=30;let n=t.getFullYear()-o+1;const r=new Date(t.getFullYear(),i,a);t<r&&(n-=1);const c=["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"],l=c[t.getMonth()],s=t.getDate(),d=getDaySuffix(s);return`${l} ${s}${d}, Year ${n}`}function getDaySuffix(e){if(e>=11&&e<=13)return"th";switch(e%10){case 1:return"st";case 2:return"nd";case 3:return"rd";default:return"th"}}const els=document.getElementsByClassName("to-elgeis-time");for(let e of els)e.textContent=formatElgeisDate(e.textContent)